This method accepts a byte array and constructs a string which represents the contents of the byte array. For instance, a byte array containing 0x6162 (two bytes) is returned as the string "6162" (four characters).
@param bytes The array which contains the bytes representing the UCS2 characters.
@param len The number of "relevant" bytes in the array.

member.remarks:
This class is capable of maintaining the configuration settings for multiple dll assemblies. For example, dllConfigurationSettings.AppSettings["dsn"] will extract the value of the dsn property from foo.dll.config should it be used within foo.dll and from bar.dll.config should it be used within bar.dll.
Note: This class cannot be used by assemblies loaded from byte arrays.
@version 05-10-2004 (ssalas) - manages config settings for multiple assemblies
@version 12-01-2002 (bwaldron) - created

member.example:
[C#]
string sDataSource = dllConfigurationSettings.AppSettings["dsn"];
[VB .NET]
Dim sDataSource as String = dllConfigurationSettings.AppSettings("dsn");

member.remarks:
            This cannot be used by assemblies loaded from byte arrays.



@version 05-10-2004 (ssalas) - when assembly in GAC, pull config file from base dir of current app domain

@version 05-10-2004 (ssalas) - tracks config settings per calling assembly

@version 12-01-2002 (bwaldron) - created

