This method allows the user to obtain the current insertion point within the contained buffer.
This method, coupled with "setPosition", allows the user to change data which was previously written to "buffer".
@return The current insertion point in the internal buffer.

This method allows the user to change the current insertion point within the contained buffer.
This method, coupled with "getPosition", allows the user to change data which was previously written to "buffer". If the specified position is less than zero, the current insertion point is set to the first byte of "buffer". If the specified position is END_OF_BUFFER, the current insertion point is set to just beyond the last byte written to "buffer".
@param position Specifies the position in the internal buffer to which the current insertion point should be set.

