@param signalIsDueToSend If true, indicates that the call to "signalEndOfPacket" was made because the user of this class called "send" while a packet was partially constructed. If false, then the call to "signalEndOfPacket" was made because the user of this class called one of the "put" methods.

Accepts a single byte and forwards it to the underlying UtilDataConsumer object.
If the specified byte is the first of a new packet, then the "signalStartOfPacket" method is called. If the specified byte completes the current packet, then the "signalEndOfPacket" method is called.
@param b The byte to be included in the packet.

Accepts an array of bytes and forwards them to the underlying UtilDataConsumer.
If the array of bytes cannot fit in the current packet, then this method fits as much as it can in the current packet, calls "signalEndOfPacket", calls "signalStartOfPacket", puts more data in the next packet, and so on until all the specified data is placed in packets.
@param b The array of bytes to be sent to the underlying UtilDataConsumer object.
@param offset The index in the byte array which indicates the starting point of the data to be sent.
@param len The number of bytes to be taken from "b" and sent to the underlying UtilDataConsumer object.

